import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as a,e as i}from"./app-72970f25.js";const o={},g=i('<p>今天给大家分享一本个人最近看过觉得非常不错的Git开源手册，可能有些小伙伴也看过了，我是最近在通勤路上用PAD看的。这本开源手册，它除了有<strong>PDF版</strong>，还有<strong>epub电子书版</strong>，非常适合电子阅读：</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-41240dae-f097-4986-b1a3-20f6a8035732.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>需要的小伙伴请扫描下方的二维码关注作者的原创公众号「<strong>沉默王二</strong>」回复关键字「<strong>git</strong>」就可以拉取到下载链接了。</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png" alt="扫码关注后回复「git」关键字" tabindex="0" loading="lazy"><figcaption>扫码关注后回复「git」关键字</figcaption></figure><p>相信看完对于个人Git知识体系的梳理和掌握是非常有帮助的。</p><p>这本手册在豆瓣上评价极高，之前9.3，现在也有9.1的高分，其作者是GitHub的员工，内容主要侧重于各种场合中的惯用法和底层原理的讲述，手册中还针对不同的使用场景，设计了几个合适的版本管理策略。简而言之，这本手册无论是对于初学者还是想进一步了解Git工作原理的开发者都非常合适。</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-66757d24-4bcb-4084-9e7f-8e9e32d517c4.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-b829ef9a-3c8f-4e91-b88b-3eeb1692d8d9.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>这个手册一共分为十章，详细内容如下：</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-33b772d5-fa59-4181-8831-9efe9c1b11ea.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><strong>手册中部分内容展示如下：</strong></p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-f8c62f18-ceaa-4de1-b7ad-961cd1418bfb.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-d82932c6-5a30-4ed6-86e5-e4ca468e8a13.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-ca7c7781-7c3f-4729-9cd7-2c050b660e4e.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-91c726c1-a10d-41fb-8b2a-a5228d741106.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><strong>需要该Git手册PDF+epub电子书的小伙伴：</strong></p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/download/progit-eff913ad-4635-498f-8a04-01a03380e84a.jpg" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>可扫描下方的二维码关注作者的原创公众号「<strong>沉默王二</strong>」回复关键字「<strong>git</strong>」就可以拉取到下载链接了。</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png" alt="扫码关注后回复「git」关键字" tabindex="0" loading="lazy"><figcaption>扫码关注后回复「git」关键字</figcaption></figure><p>好了，这次资源分享就到这里！后续如果遇到有用的工具或者资源，依然还会持续分享，也欢迎大家多多安利和交流，一起分享成长。</p>',20),r=[g];function n(c,p){return e(),a("div",null,r)}const f=t(o,[["render",n],["__file","progit.html.vue"]]);export{f as default};
